export default function Home() {
  const [selectedBox, setSelectedBox] = useState<Box | null>(null);

  const handleBoxClick = (box: Box) => {
    setSelectedBox(box);
  };

  const handleUpdateBox = (updatedBox: Box) => {
    // Implement logic to update the box
    setSelectedBox(null);
  };

  const handleDeleteBox = (box: Box) => {
    // Implement logic to delete the box
    setSelectedBox(null);
  };

  return (
    <div className='flex'>
      <Sidebar objectData={objectData} onBoxClick={handleBoxClick} />
      <Canvas objectData={objectData} />
      {selectedBox && <BoxEditor box={selectedBox} onUpdateBox={handleUpdateBox} onDeleteBox={handleDeleteBox} />}
    </div>
  );
}
